import React from 'react';

const ContactInfo = (props) => {

    return (
        <div>
            <h4>{props.addressOne}</h4>
            <h4>{props.addressTwo}</h4>
            <p>{props.phone}</p>
            <p>{props.email}</p>
            <span>{props.linkedin}</span>
        </div>
    )
  };

  export default ContactInfo;
